import { CodeIcon } from "@heroicons/react/solid";
import React from "react";
import { projects } from "../data";
import {
  Box,
  Container,
  Grid,
  GridItem,
  Heading,
  Text,
  Link,
  Image,
  useColorMode,
} from "@chakra-ui/react";

export default function Projects() {
  const { colorMode } = useColorMode();

  return (
    <Box
      id="projects"
      bg={colorMode === "light" ? "gray.100" : "gray.900"}
      color={colorMode === "light" ? "gray.800" : "gray.400"}
      py={{ base: 6, md: 10, lg: 12 }}
    >
      <Container
        maxW="container.xl"
        mx="auto"
        px={{ base: 4, md: 10, lg: 12 }}
        textAlign="center"
      >
        <Grid justify="center" align="center" mb={{ base: 6, md: 8, lg: 10 }}>
          <Heading
            as="h1"
            fontSize={{ base: "xl", md: "2xl", lg: "3xl" }}
            mb={{ base: 2, md: 4, lg: 6 }}
            color={colorMode === "light" ? "gray.900" : "white"}
          >
            Graphics Design
          </Heading>
          <Text
            fontSize={{ base: "sm", md: "md", lg: "lg" }}
            mb={{ base: 4, md: 6, lg: 8 }}
            color={colorMode === "light" ? "gray.600" : "gray.400"}
          >
            As a graphics designer, I've created a variety of projects that
            showcase my skills in visual design and creativity. From logos to
            brochures, I've got you covered.
          </Text>
        </Grid>
        <Grid
          templateColumns={{
            base: "1fr",
            sm: "repeat(2, 1fr)",
            md: "repeat(3, 1fr)",
            lg: "repeat(4, 1fr)",
          }}
          gap={{ base: 4, md: 6, lg: 8 }}
        >
          {projects.map((project) => (
            <GridItem key={project.title}>
              <Box
                bg={colorMode === "light" ? "gray.200" : "gray.800"}
                color={colorMode === "light" ? "gray.600" : "gray.400"}
                p={{ base: 2, md: 4, lg: 6 }}
                border="1px solid"
                borderColor={colorMode === "light" ? "gray.200" : "gray.800"}
                borderRadius="lg"
                boxShadow="lg"
                transition="transform 0.3s ease"
                _hover={{ transform: "translateY(-5px)", boxShadow: "xl" }}
                w={{ base: "100%", md: "300px", lg: "400px" }} // Responsive width
                mx="auto" // Centering the box
              >
                <Box position="relative" overflow="hidden" borderRadius="lg">
                  <Image
                    src={project.image}
                    alt={project.title}
                    w="full"
                    h={{ base: "100px", md: "150px", lg: "200px" }}
                    objectFit="cover"
                    objectPosition="center"
                    borderRadius="lg"
                    transition="transform 0.3s ease"
                    _hover={{
                      transform: "scale(1.1)",
                    }}
                  />
                  <Box
                    position="absolute"
                    top="0"
                    left="0"
                    w="full"
                    h="full"
                    bg={colorMode === "light" ? "gray.100" : "gray.900"}
                    opacity="0"
                    transition="opacity 0.3s ease"
                    _hover={{ opacity: 0.8 }}
                    display="flex"
                    flexDirection="column"
                    justifyContent="center"
                    alignItems="center"
                    borderRadius="lg"
                  >
                    <Heading
                      as="h2"
                      fontSize={{ base: "sm", md: "md", lg: "lg" }}
                      mb={{ base: 1, md: 2, lg: 3 }}
                      color={colorMode === "light" ? "gray.900" : "white"}
                    >
                      {project.title}
                    </Heading>
                    <Text
                      fontSize={{ base: "xs", md: "sm", lg: "md" }}
                      mb={{ base: 1, md: 2, lg: 3 }}
                      color={colorMode === "light" ? "gray.600" : "gray.400"}
                    >
                      {project.subtitle}
                    </Text>
                    <Link
                      href={project.link} // Assuming there's a link in your project data
                      isExternal
                      color={colorMode === "light" ? "green.500" : "green.300"}
                      fontWeight="bold"
                    >
                      View Project
                    </Link>
                  </Box>
                </Box>
              </Box>
            </GridItem>
          ))}
        </Grid>
      </Container>
    </Box>
  );
}
